import React from "react";
import "./Nav.css";

const Nav = () => {
  return (
    <nav>
      <div className="logo-comp">
        <p>LOGO</p>
      </div>
      <ul>
        <li>Inicio</li>
        <li>Buscar</li>
        <li>
          Gestión 
          <select>
            <option value="">Direciones</option>
            <option value="">Clientes</option>
            <option value="">Choferes</option>
          </select>
        </li>
        <li>¿Quienes somos?</li>
      </ul>
    </nav>
  );
};

export default Nav;
